	public List<InvestigationReportVO> getRequisitionNo(String crno,String days) throws Exception {
		Connection con = null;
		PreparedStatement stmt = null;
		ResultSet rs =  null;
		String queryKey = "SELECT_REQUISITIONNO_HIVT_REQUISITION_HEADER";
		InvestigationReportVO thaladirVO = null;
		List<InvestigationReportVO> reqLst = new ArrayList<InvestigationReportVO>();
		List<InvestigationReportVO> reqLstnew = new ArrayList<InvestigationReportVO>();

		try {
			System.out.println("queryKeyqueryKey"+queryKey);
			String query = HelperMethodsDAO.getQuery(propertiesFileName,queryKey);
			//con = GlobalUtils.getBloodBankUATConnection();		
			 con=super.getTransactionContext().getConnection();		
			 stmt = con.prepareStatement(query);
			stmt.setString(1, crno);
			rs =  stmt.executeQuery();
			while (rs.next()) {
				thaladirVO= new InvestigationReportVO();
	            HelperMethods.populateVOfrmRS(thaladirVO, rs);
	            reqLst.add(thaladirVO);
			}
		} catch (SQLException e){
			e.printStackTrace();
		} 
		
		
		
		if(reqLst!=null && reqLst.size()>0)
		{
			
			Map<String, InvestigationReportVO> mp=new HashMap<String, InvestigationReportVO>();
			
			for(int l=0;l<reqLst.size();l++)
			{
				
			
				InvestigationReportVO voo=reqLst.get(l);
				
				if(voo.getGroupcode()!=null)
				{
				voo.setTests(voo.getGroupcode());	
				}
				
				if(mp.containsKey(voo.getPatrequisitioNo()))
				{
					InvestigationReportVO vo= mp.get(voo.getPatrequisitioNo());
					String test=vo.getTests();
					if(! (vo.getTests().contains(voo.getTests())) )
					{
						test=test+","+voo.getTests();
					vo.setTests(test);
					}
				}
				
				else
				{
					mp.put(voo.getPatrequisitioNo(), voo);
				}
				
					
			}
			
			
			if(mp!=null && mp.size()>0)
			{
				Iterator itrreqno=mp.keySet().iterator();
                    
				while(itrreqno.hasNext())//for(int i=0;i<size;i++)
				{

					String reqno=(String)itrreqno.next();
					
					
					InvestigationReportVO data=mp.get(reqno);
					reqLstnew.add(data);
					
				}
				
			}
			
			
			
		}
		
		
			return reqLstnew;
		}
	
	
	
	
